import React, { Component } from 'react';

class Habbit extends Component {
  render() {
    return (
      <>
        <span className ="habbit-name">Reading</span>
        <span className ="habbit-count">0</span>
        <button className ="habbit-buttton habbit-increase">
          <i className="fas fa-plus"></i>
        </button>
        <button className ="habbit-buttton habbit-decrease">
          <i className="fas fa-minus"></i>
        </button>
        <button className ="habbit-buttton habbit-delete">
          <i class="fas fa-trash"></i>
        </button>
      </> 
    );
  }
}

export default Habbit;
